import React from 'react';
import { ClassNames } from 'helpers/ClassNames/ClassNames';
import cls from './ResultsTable.module.css';

export const ResultsTable = (props) => {
    const { 
        className,
        results
    } = props;

    return (
        <div className="table">
        <div className="table-header">
          <div className="header-item">Column 1</div>
          <div className="header-item">Column 2</div>
          <div className="header-item">Column 3</div>
        </div>
        <div className="table-body">
          <div className="row">
            <div className="cell">1A</div>
            <div className="cell">1B</div>
            <div className="cell">1C</div>
          </div>
          <div className="row">
            <div className="cell">2A</div>
            <div className="cell">2B</div>
            <div className="cell">2C</div>
          </div>
          <div className="row">
            <div className="cell">3A</div>
            <div className="cell">3B</div>
            <div className="cell">3C</div>
          </div>
        </div>
      </div>
 );
}
